import React from "react";
import "./Footer.css";
import Typewriter from "typewriter-effect";
const Footer = () => {
  return (
    <footer>
      <div className="footer-content">
        <div className="logo"></div>

        <p>2022 - Foxes Timereport </p>
      </div>
      <div className="footer-bottom">
        <div className="typing">
          <span class="title-holder">
            <span class="title">
              <div>
                <Typewriter
                  options={{
                    strings: [
                      "We are the foxes",
                      "Rasmus, Oliver, Pontus and Wilhelm",
                    ],
                    autoStart: true,
                    loop: true,
                  }}
                />
              </div>
            </span>
          </span>
        </div>

        <p> Â© 2022 Foxes. All right reserved </p>
      </div>
    </footer>
  );
};

export default Footer;
